import React from 'react'


const DisplayCoins = ({coinData}) => {
    const coins = coinData.map((coin) => {
        return {
            name: coin.CoinInfo.Name,
            fullName: coin.CoinInfo.FullName,
            price: coin.DISPLAY.USD.PRICE,
        }
    })
    const coinList = coins.map(coin => {
        return (
            <div className="container services">

                    <div className="col s4 center-align">
                        <div className="card">
                            <div className="card-content">
                                <i class="material-icons large">aspect_ratio</i>
                                <h5>{coin.name}</h5>
                                <p>{coin.price}</p>
                            </div>
                            <div className="card-action"><a href="#">Add to portfolio...</a></div>

                        </div>
                    </div>
            </div>








        )




    })










    console.log(coins);


    return (
        <div className="market">
            <div className="row">
                {coinList}
            </div>
        </div>
    )
}


export default DisplayCoins;
